function applyok(aobj){
			$(this).attr("disabled",true); 
			var fsgz = $("#fsgz").val();
			var jfsx = $("#jfsx").val();
			var jfxx = $("#jfxx").val();
			var kfsx = $("#kfsx").val();
			var kfxx = $("#kfxx").val();
			
			
			//判断最终得分
			var zf = "";
			if(fsgz == "1" || fsgz == "2" || fsgz == "4"){
				zf = $("#gdfs").val();
			}else if(fsgz == "3"){
				zf = $("#jdfs").val();
			}else if(fsgz == "5"){
				zf = $("#zdfs").val();
			}
			
			if(zf == "" || zf == "NULL" || zf == null || zf == "0"){
				alert("请选择或填写奖扣分数后重新提交！");
				return;
			}
			
			//判断是否拥有审核权限
			if(zf > 0){
				if(zf < jfxx || zf > jfsx){
					alert("您的奖分范围只能在 " + jfxx + "分至 " + jfsx +"分以内");
					return;
				}
			}
			if(zf < 0){
				if(zf > kfxx || zf < kfsx){
					alert("您的扣分范围只能在 " + kfxx + "分至 " + kfsx +"分以内");
					return;
				}
			}
			
			var data = {
		        "jaid" : $("#jaid").val(),
		        "jkfs" : zf,
		        "bhyy" : "",
		        "state" : "2"
			};
			
			var str = JSON.stringify(data);
			$.ajax({
				url : '${pageContext.request.contextPath}/jkapproval/jkapprovalupdate.action?rundd='+new Date().getTime(),
				type : 'post',
			 	data : {tablejson:str},
		        dataType : "json",
			    async : false,
			    success : function(date){
				 	if(date == null || date == 'null' || date == 'NULL' || date == ' ' || date["info"] == '0'){
				 		alert("服务器繁忙，提交失败");
				 		$(this).attr("disabled",false);
				 	}else{
				 		ColseModalView(pusetype);
				 	}		
			    },
			    error:function(){
					alert("网络繁忙，提交失败");
					$(this).attr("disabled",false);
				}
			});
			
		}